import React from 'react';
import './App.css';
import Header from './Header'
import Home from './Home'
import Checkout from './Checkout'
import Login from './Login'
import {BrowserRouter as Router, Switch,Route} from "react-router-dom";

function App() {
  return (
  <Router>
    <div className="app">
    <Header />
      <Switch>


      <Route path="/checkout">
        <Checkout />
      </Route>

      <Route path="/">
        <Home />
      </Route>

      <Route path="/login">
        <Login />
      </Route>



      </Switch>  
    </div>
  </Router> 
  );
}

export default App;
